INSERT INTO `page_translations` VALUES (1,1,'en','Profile','<div id=\"company-profile\">\r\n<h2 class=\"mgt-profile\" style=\"text-align: left;\">About Us</h2>\r\n<p class=\"mgt-profile\">Moving forward with humility is the mantra for us to grow and excel. From a very humble start with 2 employees in 1992 and a small 500 square feet facility in Chandigarh, company now owns two full fledged units with total 18,000 square feet of working facility and a strong and dedicated team of professionals. Company is geared to move forward by adding latest machinery and creating backups in each process to provide sustainable packaging to our customers.</p>\r\n<p class=\"mgt-profile\">&nbsp;</p>\r\n<h3 class=\"custom-page-head\" style=\"text-align: left;\"><strong>Vision | Mission | Values</strong></h3>\r\n<div class=\"custom-page-inner\">\r\n<p><strong>Vision</strong><span style=\"font-weight: 400;\">: To provide Eco Friendly Unique Packaging Solution to Our Customers with products of highest Quality Standards. To establish lasting relationships for sustained growth and development of our company, employees and shareholders</span></p>\r\n</div>\r\n<div class=\"custom-page-inner\">\r\n<p><strong>Mission</strong><span style=\"font-weight: 400;\">: </span><span style=\"font-weight: 400;\">To grow as a market leader in providing range of packaging products with best possible packaging solutions.&nbsp;</span></p>\r\n<p><span style=\"font-weight: 400;\">To create an environment in which our employees feel welcomed and in which they can grow.</span></p>\r\n<p><span style=\"font-weight: 400;\">To utilize every opportunity to provide unparalleled quality and services</span></p>\r\n</div>\r\n<div class=\"custom-page-inner\">\r\n<p><strong>Values</strong><span style=\"font-weight: 400;\">:</span><span style=\"font-weight: 400;\"> </span><span style=\"font-weight: 400;\"> Reliability for customers, Passionate about what we do, Collaborative to work as a Team and Trustworthy for our all stakeholders&nbsp;</span></p>\r\n</div>\r\n</div>'),(5,5,'en','Terms','<div id=\"company-profile\">\r\n<p class=\"custom-page-head\"><strong>GENERAL CONSIDERATIONS AND SCOPE</strong></p>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers, Plot No 3136, Phase 2, Industrial Area, Chandigarh 160002, India maintains the internet portal https://www.modernpackagers.com, an ecommerce packaging material online portal. On Modern Packagers customers will be offered versatile packaging materials.The offering on this site is only directed at end users of legal age. These terms and conditions find application in all contracts which members enter into via Modern Packagers. Modern Packagers does not accept any other terms and conditions unless explicitly stated otherwise. If periods are stated in working days, these include all weekdays except Saturday and Sunday and all statutory holidays.</span></p>\r\n<p class=\"custom-page-head\"><strong>Use Of Modern Packagers</strong></p>\r\n<p><span style=\"font-weight: 400;\">As part of the registration as a customer of Modern Packagers you will be asked to submit personal data. You are responsible for ensuring that the data is complete and correct. After you have completed the registration process, you will receive a confirmation of your registration by email. You are obliged to treat your login Id and password and any other access data confidential and protected from access by unauthorized third parties. Modern Packagers reserves the right to refuse registration without giving reasons.</span></p>\r\n<p><span style=\"font-weight: 400;\">You indemnify Modern Packagers completely of any claim by third parties on first demand. By transmitting the contents to Modern Packagers, you grant Modern Packagers all exclusive rights of use over time, space and content without restriction, including transfer to a third party, which Modern Packagers requires for publication and dissemination, even in part, to Modern Packagers. Modern Packagers is entitled to store or release content, and reserves the right of cancellation, reduction, modification or correction of such content.</span></p>\r\n<p><span style=\"font-weight: 400;\">You may not use Modern Packagers outside the intended frame to disrupt or manipulate particular technical processes. Interventions with the intention to seek unjustified advantage to the detriment of Modern Packagers or other members will result in the immediate loss of the right to purchase on Modern Packagers and the revocation of the customer&rsquo;s account as a consequence.</span></p>\r\n<p><span style=\"font-weight: 400;\">You are only permitted to register and use one membership account at a time. Multiple registrations will be deleted by Modern Packagers.</span></p>\r\n<p><span style=\"font-weight: 400;\">In the password protected area on Modern Packagers you can access your recently shipped and/or completed orders. In this area you can also change, administer and save your own data and potential subscriptions of newsletters.</span></p>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers reserves the right to issue a warning, to terminate your membership or to modify or delete content you have submitted, if you violate any of the provisions. Any claims for damages by Modern Packagers remain unaffected.</span></p>\r\n<p class=\"custom-page-head\"><strong>CONTRACTUAL PARTNERS, LANGUAGE AND CONCLUSION OF CONTRACT</strong></p>\r\n<p><span style=\"font-weight: 400;\">At the conclusion of contracts on Modern Packagers your contractual partner is solely Modern Packagers.</span></p>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers is operated in English; Modern Packagers contracts are concluded exclusively in English.</span></p>\r\n<p><span style=\"font-weight: 400;\">By submitting an order by clicking \"order or buy now\" you make a binding contract offer. After submitting your order, you will receive a confirmation email from Modern Packagers. The confirmation email does not constitute acceptance of the contract. The declaration of acceptance of the contract consists in the shipping of the goods. When ordering multiple items, the acceptance of the contract applies only to goods actually shipped.</span></p>\r\n<p><span style=\"font-weight: 400;\">In cases where prices are displayed incorrectly on Modern Packagers due to technical errors, Modern Packagers is entitled to action for nullification. The burden of proof regarding an error lies with Modern Packagers Payments already made will be refunded immediately.</span></p>\r\n<p class=\"custom-page-head\"><strong>PRICES AND SHIPPING FEES</strong></p>\r\n<p><span style=\"font-weight: 400;\">For orders on Modern Packagers the prices which are listed at the time of your order on the product page apply. The final price (inclusive of taxes) is showed in the shopping cart page.</span></p>\r\n<p><span style=\"font-weight: 400;\">For returns of products, contact the Modern Packagers customer support via&nbsp;support@modernpackagers.com&nbsp;or via our online Chat Support.</span></p>\r\n<p class=\"custom-page-head\"><strong>PAYMENTS</strong></p>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers provides the payment methods credit card, debit card and net banking payment in advance, Bank Transfer, Pay with Paypal. Modern Packagers reserves the right to exclude any payment methods for individual goods and to refer to the other payment methods. Modern Packagers accepts various credit cards, e.g. Visa, American Express, Mastercard and more.</span></p>\r\n<p class=\"custom-page-head\"><strong>COUPONS / WALLET OFFERS</strong></p>\r\n<p><span style=\"font-weight: 400;\">The following provisions apply to all coupons and wallet offers of Modern Packagers. The vouchers include specifically the vouchers as a result of purchase of an invited friend of Modern Packagers and vouchers individually assigned to individual customers at Modern Packagers.</span></p>\r\n<p><span style=\"font-weight: 400;\">Vouchers are only valid for the period announced at issue or a maximum of 30 days from the time of issuance. An extension or a transfer to another user/ customer is not possible. Vouchers are non-transferable.</span></p>\r\n<p><span style=\"font-weight: 400;\">Vouchers cannot be deducted from shipping costs, if applicable. Should the price of your order exceed the balance in a voucher, you can compensate the difference through the payment methods available.</span></p>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers reserves the right to accept only one coupon per order. Vouchers are not paid in cash or earn interest.</span></p>\r\n<p><span style=\"font-weight: 400;\">Vouchers will not be refunded, should you return the goods wholly or partly, or if goods can only be delivered in part. Lost or, in particular, stolen vouchers will not be refunded. Modern Packagers assumes no liability for lost vouchers.</span></p>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers reserves the right to provide alternative payment methods and to refuse delivery and / or to terminate customer accounts should there be a reasonable suspicion of abuse in connection with the use of vouchers.</span></p>\r\n<p class=\"custom-page-head\"><strong>LIABILITIES</strong></p>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers is liable only for intent and gross negligence, unless there are fraudulently concealed damages, damages for loss of life, limb or health or damage arising from any infringement of essential contractual obligations.</span></p>\r\n<p class=\"custom-page-head\"><strong>SERVICE AND COMPLAINTS</strong></p>\r\n<p><span style=\"font-weight: 400;\">The satisfaction of our customers and clients is of paramount concern for Packman Packaging. Therefore, we endeavor to deal with your concerns as quickly as possible and always provide you with our feedback after receiving your input. For service inquiries, please contact our customer service department: Email:&nbsp;support@Modern Packagers</span></p>\r\n<p class=\"custom-page-head\"><strong>DISCLAIMER FOR HYPERTEXT LINKS</strong></p>\r\n<p><span style=\"font-weight: 400;\">The web site www.ModernPackagers.com includes hyperlinks to other Internet sites. Modern packagers have no control over the content of these sites, nor does it endorse them and is not responsible for their content. Once Modern Packagers becomes aware of illegal content, Modern Packagers will remove the corresponding links from Modern Packagers</span></p>\r\n<p class=\"custom-page-head\"><strong>DATA SECURITY</strong></p>\r\n<p><span style=\"font-weight: 400;\">As part of your registration as a customer on Modern Packagers.com you will be asked to provide personal data. This is data which is required by Modern Packagers to process the contracts concluded on Modern Packagers. All personal data is confidential and will be treated by Modern Packagers in accordance with relevant legal regulations. To safeguard your privacy in online payment transactions Modern Packagers uses the latest encryption techniques through our payment gateways.</span></p>\r\n<p class=\"custom-page-head\"><strong>IMAGE RIGHTS</strong></p>\r\n<p><span style=\"font-weight: 400;\">All rights to use imagery on Modern Packagers lie with Modern Packagers or our partners. The use of the material - in whatever form - is prohibited unless explicit permission from Modern Packagers has been granted.</span></p>\r\n<p class=\"custom-page-head\"><strong>CANCELLATION and REFUND POLICY</strong></p>\r\n<p><span style=\"font-weight: 400;\">In order to get your order delivered to you soon, we start the process on the same day. As long as your order has not been processed, you can cancel or get in touch with our customer support team to cancel your order. The full refund will be initiated online in your bank account. However, the cancellation of orders will be done only if the terms and conditions listed below are met.</span></p>\r\n<p><strong>In case of printed products</strong><span style=\"font-weight: 400;\">&nbsp;You can cancel your orders within 24 hour of booking the same order from your current order page.</span></p>\r\n<p><strong>In case of non-printed products</strong><span style=\"font-weight: 400;\">&nbsp;You can cancel your orders before the shipment of your product. You are requested to immediately email at&nbsp;</span><strong>support@greenhandle</strong><span style=\"font-weight: 400;\">.in or call at&nbsp;</span><strong>(+91) 74003 29494</strong><span style=\"font-weight: 400;\">&nbsp;along with your order number for any cancellations to be made, if you are not able to do it online.</span></p>\r\n<p class=\"custom-page-head\"><strong>Return and Refund</strong></p>\r\n<p><span style=\"font-weight: 400;\">We at Modern packagers strive to provide the best possible shopping experience. While there is no option to return orders as the goods are customized according to your specific needs (Return and replacement will be offered by us if and only if the product you received is completely different from what you ordered), However, if at all you are not satisfied with your purchase, complete assistance would be given to you regarding the same.</span></p>\r\n<p><span style=\"font-weight: 400;\">If you order from Ready to Deliver and Ecological Ad bags section then you can return the products to us within 5 days from the date of delivery.</span></p>\r\n<p><strong>You can return products under following circumstances.</strong></p>\r\n<ul class=\"profile-lists\">\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">If ordered product is not the one which was ordered.</span></li>\r\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">If ordered product is damaged.</span></li>\r\n</ul>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers also provides return option up to 7 days from the date of delivery under critical cases such as the product was different from the description, defective, used or missing.</span></p>\r\n<p><span style=\"font-weight: 400;\">For any other queries, please call at (+91)9779883919. Or you can drop an email at support@modernpackagers.com</span></p>\r\n<p class=\"custom-page-head\"><strong>FINAL PROVISION</strong></p>\r\n<p><span style=\"font-weight: 400;\">Should any provision of this agreement be legally void, this does not invalidate the whole contract. Instead, the invalid provision shall be replaced with an effective provision with the same economic purpose. The same applies to possible gaps in this contract.</span></p>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers reserves the right to amend these terms and conditions for future business. Excluded from this are unreasonable changes, especially pertaining to essential contract elements, such as the main benefits owed, which would be subject of a contract modification.</span></p>\r\n<p><span style=\"font-weight: 400;\">Modern Packagers will notify you of changes to the Terms and Conditions in timely fashion. Notification of changes will include a reference to the possibility and the period of objection and the significance or consequences of the omission of contradiction. If you do not contradict the validity of the amended Terms and Conditions within two weeks of the day following the receipt of the notification of change to you, the amended terms and conditions shall be deemed accepted by you.</span></p>\r\n</div>'),(6,6,'en','Privacy','<h3 style=\"box-sizing: border-box; font-weight: 500; line-height: 1.1; font-size: 24px; margin-top: 20px; margin-bottom: 10px; font-family: \'open sans\', sans-serif; color: #333333; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: medium; font-family: \'arial black\', \'avant garde\';\">Collection of Information:</span></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'open sans\', sans-serif; font-size: 12px; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: small;\">We consider the privacy of our customer&rsquo;s utmost important. We are in the business of serving you, not selling your information. Your name, address information, and credit card information are collected only to fulfill your order. Information security is critical to our business. We use advanced security technology to prevent our computers from being accessed by unauthorized persons. We do not distribute customer information to be used in mailing lists, surveys, or any other purpose other than what is required to perform our services. Shopping with us is 100% safe!!</span></p>\r\n<h3 style=\"box-sizing: border-box; font-weight: 500; line-height: 1.1; font-size: 24px; margin-top: 20px; margin-bottom: 10px; font-family: \'open sans\', sans-serif; color: #333333; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: medium; font-family: \'arial black\', \'avant garde\';\">Use and Sharing of Information:</span></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'open sans\', sans-serif; font-size: 12px; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: small;\">At no time will we sell your personally-identifiable data without your permission unless set forth in this Privacy Policy. The information we receive about you or from you may be used by us or shared by us with our corporate affiliates, dealers, agents, vendors and other third parties to help process your request; to comply with any law, regulation, audit or court order; to help improve our website or the products or services we offer; for research; to better understand our customers\' needs; to develop new offerings; and to alert you to new products and services (of us or our business associates) in which you may be interested. We may also combine information you provide us with information about you that is available to us internally or from other sources in order to better serve you. We do not share, sell, trade or rent your personal information to third parties for unknown reasons.</span></p>\r\n<h3 style=\"box-sizing: border-box; font-weight: 500; line-height: 1.1; font-size: 24px; margin-top: 20px; margin-bottom: 10px; font-family: \'open sans\', sans-serif; color: #333333; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-family: \'arial black\', \'avant garde\'; font-size: medium;\">Cookies:</span></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'open sans\', sans-serif; font-size: 12px; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: small;\">From time to time, we may place \"cookies\" on your personal computer. \"Cookies\" are small identifiers sent from a web server and stored on your computer\'s hard drive, that help us to recognize you if you visit our website again. Also, our site uses cookies to track how you found our site. To protect your privacy we do not use cookies to store or transmit any personal information about you on the Internet. You have the ability to accept or decline cookies. Most web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. If you choose to decline cookies certain features of the site may not function property or at all as a result.</span></p>\r\n<h3 style=\"box-sizing: border-box; font-weight: 500; line-height: 1.1; font-size: 24px; margin-top: 20px; margin-bottom: 10px; font-family: \'open sans\', sans-serif; color: #333333; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: medium; font-family: \'arial black\', \'avant garde\';\">Links:</span></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'open sans\', sans-serif; font-size: 12px; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: small;\">Our website contains links to other sites. Such other sites may use information about your visit to this website. Our Privacy Policy does not apply to practices of such sites that we do not own or control or to people we do not employ. Therefore, we are not responsible for the privacy practices or the accuracy or the integrity of the content included on such other sites. We encourage you to read the individual privacy statements of such websites.</span></p>\r\n<h3 style=\"box-sizing: border-box; font-weight: 500; line-height: 1.1; font-size: 24px; margin-top: 20px; margin-bottom: 10px; font-family: \'open sans\', sans-serif; color: #333333; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: medium; font-family: \'arial black\', \'avant garde\';\">Security:</span></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'open sans\', sans-serif; font-size: 12px; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: small;\">We safeguard your privacy using known security standards and procedures and comply with applicable privacy laws. Our websites combine industry-approved physical, electronic and procedural safeguards to ensure that your information is well protected though it\'s life cycle in our infrastructure.&nbsp;Sensitive data is hashed or encrypted when it is stored in our infrastructure. Sensitive data is decrypted, processed and immediately re-encrypted or discarded when no longer necessary. We host web services in audited data centers, with restricted access to the data processing servers. Controlled access, recorded and live-monitored video feeds, 24/ 7 staffed security and biometrics provided in such data centers ensure that we provide secure hosting.</span></p>\r\n<h3 style=\"box-sizing: border-box; font-weight: 500; line-height: 1.1; font-size: 24px; margin-top: 20px; margin-bottom: 10px; font-family: \'open sans\', sans-serif; color: #333333; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-family: \'arial black\', \'avant garde\'; font-size: medium;\">Opt-Out Policy:</span></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'open sans\', sans-serif; font-size: 12px; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: small;\">Please email to us at if you no longer wish to receive any information from us.</span></p>\r\n<h3 style=\"box-sizing: border-box; font-weight: 500; line-height: 1.1; font-size: 24px; margin-top: 20px; margin-bottom: 10px; font-family: \'open sans\', sans-serif; color: #333333; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-family: \'arial black\', \'avant garde\'; font-size: medium;\">Changes to this Privacy Policy:</span></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'open sans\', sans-serif; font-size: 12px; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: small;\">Our privacy policy was last updated on &lt;08/08/2016 &gt;. We may change our Privacy Policy from time to time. If we do, we will update this Privacy Policy on our website.</span></p>\r\n<h3 style=\"box-sizing: border-box; font-weight: 500; line-height: 1.1; font-size: 24px; margin-top: 20px; margin-bottom: 10px; font-family: \'open sans\', sans-serif; color: #333333; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-family: \'arial black\', \'avant garde\'; font-size: medium;\">Questions</span></h3>\r\n<p style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: \'open sans\', sans-serif; font-size: 12px; letter-spacing: 1px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; font-size: small;\">If you have any questions about our Privacy Policy, please e-mail your questions to us at&nbsp;support@modernpackagers.com</span></p>'),(7,7,'en','Customized Packaging','<p><code>&lt;h1&gt;</code>hello<code>&lt;/h1&gt;</code></p>');
